import React, {useEffect, useState} from 'react';
import Dropdown from './dropdown';
import './rating.css';

function RateText() {

    const [notes, setNotes] = useState([{
        title: '',
        text: ''
    }])



    useEffect(() => {
        fetch("/rating").then(res => {
           if(res.ok) {
               return res.json()
           }
        }).then(jsonRes => setNotes(jsonRes));
    })

    return (
        <div style={{maxWidth:"inherit"}} className="container">
            <row style={{maxWidth:"inherit"}}>
                <div className="col-sm-6">
            <Dropdown />

            {notes.map(note =>
            <div style={{marginTop:'5%'}}> 
                <h1>{note.title}</h1>
                <p>{note.text}</p>
            </div>
            )}
          </div>
                <div className="col-sm-6">
            <Dropdown />

            {notes.map(note =>
            <div style={{marginTop:'5%'}}> 
                <h1>{note.title}</h1>
                <p>{note.text}</p>
            </div>
            )}
          </div>
        </row>
    </div>
    )};

export default RateText;
